          "message": "Merge #36\n\n36: Update criterion requirement from 0.3 to 0.4 r=mbrobbel a=dependabot[bot]\n\nUpdates the requirements on [criterion](https://github.com/bheisler/criterion.rs) to permit the latest version.\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/bheisler/criterion.rs/blob/master/CHANGELOG.md\">criterion's changelog</a>.</em></p>\n<blockquote>\n<h2>[0.4.0] - 2022-09-10</h2>\n<h3>Removed</h3>\n<ul>\n<li>The <code>Criterion::can_plot</code> function has been removed.</li>\n<li>The <code>Criterion::bench_function_over_inputs</code> function has been removed.</li>\n<li>The <code>Criterion::bench_functions</code> function has been removed.</li>\n<li>The <code>Criterion::bench</code> function has been removed.</li>\n</ul>\n<h3>Changed</h3>\n<ul>\n<li>HTML report hidden behind non-default feature flag: 'html_reports'</li>\n<li>Standalone support (ie without cargo-criterion) feature flag: 'cargo_bench_support'</li>\n<li>MSRV bumped to 1.57</li>\n<li><code>rayon</code> and <code>plotters</code> are optional (and default) dependencies.</li>\n<li>Status messages ('warming up', 'analyzing', etc) are printed to stderr, benchmark results are printed to stdout.</li>\n<li>Accept subsecond durations for <code>--warm-up-time</code>, <code>--measurement-time</code> and <code>--profile-time</code>.</li>\n<li>Replaced serde_cbor with ciborium because the former is no longer maintained.</li>\n<li>Upgrade clap to v3 and regex to v1.5.</li>\n</ul>\n<h3>Added</h3>\n<ul>\n<li>A <code>--discard-baseline</code> flag for discarding rather than saving benchmark results.</li>\n<li>Formal support for benchmarking code compiled to web-assembly.</li>\n<li>A <code>--quiet</code> flag for printing just a single line per benchmark.</li>\n<li>A <code>Throughput::BytesDecimal</code> option for measuring throughput in bytes but printing them using\ndecimal units like kilobytes instead of binary units like kibibytes.</li>\n</ul>\n<h3>Fixed</h3>\n<ul>\n<li>When using <code>bench_with_input</code>, the input parameter will now be passed through <code>black_box</code> before\npassing it to the benchmark.</li>\n</ul>\n<h2>[0.3.6] - 2022-07-06</h2>\n<h3>Changed</h3>\n<ul>\n<li>MSRV bumped to 1.49</li>\n<li>Symbol for microseconds changed from ASCII 'us' to unicode 'µs'</li>\n<li>Documentation fixes</li>\n<li>Clippy fixes</li>\n</ul>\n<h2>[0.3.5] - 2021-07-26</h2>\n<h3>Fixed</h3>\n<ul>\n<li>Corrected <code>Criterion.toml</code> in the book.</li>\n<li>Corrected configuration typo in the book.</li>\n</ul>\n<h3>Changed</h3>\n<ul>\n<li>Bump plotters dependency to always include a bug-fix.</li>\n<li>MSRV bumped to 1.46.</li>\n</ul>\n<!-- raw HTML omitted -->\n</blockquote>\n<p>... (truncated)</p>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/5e27b692a43a05736d073fd449e16dcf1c24628c\"><code>5e27b69</code></a> Merge branch 'version-0.4'</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/4d6d69a9f56744f89d6143f928074dbd47d0512b\"><code>4d6d69a</code></a> Increment version numbers.</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/935c6327e152e44f2b9178797682b9b99b5123a5\"><code>935c632</code></a> Add Throughput::BytesDecimal. Fixes <a href=\"https://github-redirect.dependabot.com/bheisler/criterion.rs/issues/581\">#581</a>.</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/f82ce59d710e8b5cc30b9a9b07a9da3e8e715768\"><code>f82ce59</code></a> Remove critcmp code (it belongs in cargo-criterion) (<a href=\"https://github-redirect.dependabot.com/bheisler/criterion.rs/issues/610\">#610</a>)</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/a18d0800a92c3bc259e3542f0399c0decc594c2c\"><code>a18d080</code></a> Merge branch 'master' into version-0.4</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/f9c6b8d1c0b0329148123b27a91ab7316ff4108e\"><code>f9c6b8d</code></a> Merge pull request <a href=\"https://github-redirect.dependabot.com/bheisler/criterion.rs/issues/608\">#608</a> from Cryptex-github/patch-1</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/8d0224e9f1704deae2b4206fff2b8b6bf8f7c9c0\"><code>8d0224e</code></a> Fix html report path</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/2934163518a75bf037c7467c0a1d28443203eabf\"><code>2934163</code></a> Add missing black_box for bench_with_input parameters. Fixes 566.</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/dfd7b6532b0aa76e1aee80ae061e7e1b7a12c561\"><code>dfd7b65</code></a> Add duplicated benchmark ID to assertion message.</li>\n<li><a href=\"https://github.com/bheisler/criterion.rs/commit/ce8259e69fb44e2331e70af621e3719dbc84e601\"><code>ce8259e</code></a> Bump criterion-plot version number.</li>\n<li>Additional commits viewable in <a href=\"https://github.com/bheisler/criterion.rs/compare/0.3.0...0.4.0\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting ``@dependabot` rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- ``@dependabot` rebase` will rebase this PR\n- ``@dependabot` recreate` will recreate this PR, overwriting any edits that have been made to it\n- ``@dependabot` merge` will merge this PR after your CI passes on it\n- ``@dependabot` squash and merge` will squash and merge this PR after your CI passes on it\n- ``@dependabot` cancel merge` will cancel a previously requested merge and block automerging\n- ``@dependabot` reopen` will reopen this PR if it is closed\n- ``@dependabot` close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- ``@dependabot` ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- ``@dependabot` ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- ``@dependabot` ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n\n\n</details>\n\nCo-authored-by: dependabot[bot] <49699333+dependabot[bot]@users.noreply.github.com>\nCo-authored-by: Matthijs Brobbel <m1brobbel@gmail.com>",
